import Home from '../components/Home';
import ConferenceRoom from '../components/ConferenceRoom';

const routes: RouteDef[] = [
  {
    path: '/',
    component: Home,
  },
  {
    path: '/conferenceRoom',
    component: ConferenceRoom,
  },
];

export default routes;
